-- ----------------------------
-- Table structure for sale
-- ----------------------------
DROP TABLE IF EXISTS `sale`;
CREATE TABLE `sale` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) DEFAULT NULL COMMENT '用户id',
  `username` varchar(30) DEFAULT NULL COMMENT '用户名',
  `tid` int(11) DEFAULT '0' COMMENT '被返点用户id',
  `tusername` varchar(30) DEFAULT NULL COMMENT '被返点用户名',
  `money` decimal(10,2) DEFAULT '0.00' COMMENT '当次金额',
  `time` datetime DEFAULT NULL COMMENT '日期',
  `status` tinyint(3) DEFAULT '0' COMMENT '金额+-状态 （1 -;2 +;)',
  `type` tinyint(3) DEFAULT '0' COMMENT '交易类型(1开码;2货款;3提现;4佣金5直接推荐返现;6间接推荐返现;7直接返点;8间接返点;9团队新生成管家返现;10育成团队返点)',
  `zf_type` tinyint(3) DEFAULT '1' COMMENT '支付类型(1交易成功;2微信支付;3余额支付)',
  `make_status` tinyint(3) DEFAULT '0' COMMENT '打款状态(0未打款;1已打款)',
  `total_money` decimal(10,2) DEFAULT '0.00' COMMENT '货款金额',
  `transaction_id` varchar(50) DEFAULT NULL COMMENT '微信单号',
  `out_trade_no` varchar(50) DEFAULT NULL COMMENT '商户单号',
  `make_time` datetime DEFAULT NULL COMMENT '打款日期',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2928 DEFAULT CHARSET=utf8mb4 COMMENT='销售';

