INSERT INTO `gs` VALUES (1, '<p class=\"MsoNormal\" align=\"center\" style=\"text-align: center;\"><b><spanyes\';font-family:宋体;mso-ascii-font-family:calibri;mso-hansi-font-family:calibri;mso-bidi-font-family:\'times new=\"\" roman\';font-weight:bold;font-size:24.0000pt;mso-font-kerning:1.0000pt;\"=\"\"><font face=\"宋体\">一起购电子商务有限公司</font></spanyes\';font-family:宋体;mso-ascii-font-family:calibri;mso-hansi-font-family:calibri;mso-bidi-font-family:\'times></b><b><spanyes\';font-family:calibri;mso-fareast-font-family:宋体;mso-bidi-font-family:\'times new=\"\" roman\';font-weight:bold;font-size:24.0000pt;mso-font-kerning:1.0000pt;\"=\"\"><o:p></o:p></spanyes\';font-family:calibri;mso-fareast-font-family:宋体;mso-bidi-font-family:\'times></b></p><p class=\"MsoNormal\"><spanyes\';font-family:calibri;mso-fareast-font-family:宋体;mso-bidi-font-family:\'times new=\"\" roman\';font-size:16.0000pt;mso-font-kerning:1.0000pt;\"=\"\"><o:p>&nbsp;</o:p></spanyes\';font-family:calibri;mso-fareast-font-family:宋体;mso-bidi-font-family:\'times></p><p class=\"MsoNormal\"><spanyes\';font-family:宋体;mso-ascii-font-family:calibri;mso-hansi-font-family:calibri;mso-bidi-font-family:\'times new=\"\" roman\';color:rgb(255,0,0);font-size:14.0000pt;mso-font-kerning:1.0000pt;\"=\"\"><font face=\"宋体\">一、公司简介</font><spanyes\';font-family:calibri;mso-fareast-font-family:宋体;mso-bidi-font-family:\'times new=\"\" roman\';color:rgb(255,0,0);font-size:14.0000pt;mso-font-kerning:1.0000pt;\"=\"\"><o:p></o:p></spanyes\';font-family:calibri;mso-fareast-font-family:宋体;mso-bidi-font-family:\'times></spanyes\';font-family:宋体;mso-ascii-font-family:calibri;mso-hansi-font-family:calibri;mso-bidi-font-family:\'times></p><p class=\"MsoNormal\"><spanyes\';font-family:宋体;mso-ascii-font-family:calibri;mso-hansi-font-family:calibri;mso-bidi-font-family:\'times new=\"\" roman\';font-size:14.0000pt;mso-font-kerning:1.0000pt;\"=\"\"><font face=\"宋体\">东港一起购电子商务有限公司成立于</font>2018<font face=\"宋体\">年</font><font face=\"Calibri\">8</font><font face=\"宋体\">月，是一家以“社交电商</font><font face=\"Calibri\">+</font><font face=\"宋体\">新零售”分享经济模式的综合精选型购物平台，产品覆盖生鲜、活鲜、即食、农产品，生活管家一站式服务，旨在为消费者甄选高性价比的好物！</font><spanyes\';font-family:calibri;mso-fareast-font-family:宋体;mso-bidi-font-family:\'times new=\"\" roman\';font-size:14.0000pt;mso-font-kerning:1.0000pt;\"=\"\"><o:p></o:p></spanyes\';font-family:calibri;mso-fareast-font-family:宋体;mso-bidi-font-family:\'times></spanyes\';font-family:宋体;mso-ascii-font-family:calibri;mso-hansi-font-family:calibri;mso-bidi-font-family:\'times></p><p class=\"MsoNormal\"><spanyes\';font-family:宋体;mso-ascii-font-family:calibri;mso-hansi-font-family:calibri;mso-bidi-font-family:\'times new=\"\" roman\';font-size:14.0000pt;mso-font-kerning:1.0000pt;\"=\"\"><font face=\"宋体\">集合社交网络与共享经济，一起购以</font>“社交电商<font face=\"Calibri\">+</font><font face=\"宋体\">新零售”的创新电商模式，目前已成为中国社交零售平台的领军者！这一模式已成为“互联网</font><font face=\"Calibri\">+</font><font face=\"宋体\">的创业新出路”。</font><spanyes\';font-family:calibri;mso-fareast-font-family:宋体;mso-bidi-font-family:\'times new=\"\" roman\';font-size:14.0000pt;mso-font-kerning:1.0000pt;\"=\"\"><o:p></o:p></spanyes\';font-family:calibri;mso-fareast-font-family:宋体;mso-bidi-font-family:\'times></spanyes\';font-family:宋体;mso-ascii-font-family:calibri;mso-hansi-font-family:calibri;mso-bidi-font-family:\'times></p><p class=\"MsoNormal\" style=\"text-align: center;\"><spanyes\';font-family:calibri;mso-fareast-font-family:宋体;mso-bidi-font-family:\'times new=\"\" roman\';font-size:14.0000pt;mso-font-kerning:1.0000pt;\"=\"\"><o:p><img src=\"data:image/png;base64,\" style=\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, &quot;Luxi Sans&quot;, &quot;DejaVu Sans&quot;, &quot;Hiragino Sans GB&quot;, serif; font-size: 12px; max-width: 100%;\">&nbsp;</o:p></spanyes\';font-family:calibri;mso-fareast-font-family:宋体;mso-bidi-font-family:\'times></p><p class=\"MsoNormal\"><!--[if !supportLists]--><spantimes new=\"\" roman\';color:rgb(255,0,0);font-size:14.0000pt;mso-font-kerning:1.0000pt;\"=\"\"><span>二、</span><!--[endif]--><spanyes\';font-family:宋体;mso-ascii-font-family:calibri;mso-hansi-font-family:calibri;mso-bidi-font-family:\'times new=\"\" roman\';color:rgb(255,0,0);font-size:14.0000pt;mso-font-kerning:1.0000pt;\"=\"\"><font face=\"宋体\">商城品类齐全</font><spanyes\';font-family:calibri;mso-fareast-font-family:宋体;mso-bidi-font-family:\'times new=\"\" roman\';color:rgb(255,0,0);font-size:14.0000pt;mso-font-kerning:1.0000pt;\"=\"\"><o:p></o:p></spanyes\';font-family:calibri;mso-fareast-font-family:宋体;mso-bidi-font-family:\'times></spanyes\';font-family:宋体;mso-ascii-font-family:calibri;mso-hansi-font-family:calibri;mso-bidi-font-family:\'times></spantimes></p><p class=\"MsoNormal\"><spanyes\';font-family:宋体;mso-ascii-font-family:calibri;mso-hansi-font-family:calibri;mso-bidi-font-family:\'times new=\"\" roman\';font-size:14.0000pt;mso-font-kerning:1.0000pt;\"=\"\"><font face=\"宋体\">公司坐落于美丽的沿海城市</font>---<font face=\"宋体\">东港（东港市</font><spanyes\';font-family:宋体;mso-ascii-font-family:arial;mso-hansi-font-family:arial;mso-bidi-font-family:arial;color:rgb(51,51,51);font-size:14.0000pt;mso-font-kerning:1.0000pt;background:rgb(255,255,255);mso-shading:rgb(255,255,255);\"><font face=\"宋体\">地处东北亚、环渤海和环黄海三个经济圈的交汇点，是连接中、朝、韩、俄、日五国的交通枢纽、欧亚大通道的重要节点，是东北东部地区重要的海陆门户），所处地理位置拥有江、海、湖，</font><spanyes\';font-family:宋体;mso-ascii-font-family:calibri;mso-hansi-font-family:calibri;mso-bidi-font-family:\'times new=\"\" roman\';font-size:14.0000pt;mso-font-kerning:1.0000pt;\"=\"\"><font face=\"宋体\">依托着极其丰富的水产品资源优势，严格的质量把关体系，对各地海域的海鲜进行严格筛选并进行整合，致力于把最好的产品带给消费者。公司于沈阳、吉林、长春均设立有办事处。</font><spanyes\';font-family:calibri;mso-fareast-font-family:宋体;mso-bidi-font-family:\'times new=\"\" roman\';font-size:14.0000pt;mso-font-kerning:1.0000pt;\"=\"\"><o:p></o:p></spanyes\';font-family:calibri;mso-fareast-font-family:宋体;mso-bidi-font-family:\'times></spanyes\';font-family:宋体;mso-ascii-font-family:calibri;mso-hansi-font-family:calibri;mso-bidi-font-family:\'times></spanyes\';font-family:宋体;mso-ascii-font-family:arial;mso-hansi-font-family:arial;mso-bidi-font-family:arial;color:rgb(51,51,51);font-size:14.0000pt;mso-font-kerning:1.0000pt;background:rgb(255,255,255);mso-shading:rgb(255,255,255);\"></spanyes\';font-family:宋体;mso-ascii-font-family:calibri;mso-hansi-font-family:calibri;mso-bidi-font-family:\'times></p><p class=\"MsoNormal\"><!--[if !supportLists]--><spantimes new=\"\" roman\';color:rgb(255,0,0);font-size:14.0000pt;mso-font-kerning:1.0000pt;\"=\"\"><span>三、</span><!--[endif]--><spanyes\';font-family:宋体;mso-ascii-font-family:calibri;mso-hansi-font-family:calibri;mso-bidi-font-family:\'times new=\"\" roman\';color:rgb(255,0,0);font-size:14.0000pt;mso-font-kerning:1.0000pt;\"=\"\"><font face=\"宋体\">自购省钱</font><spanyes\';font-family:calibri;mso-fareast-font-family:宋体;mso-bidi-font-family:\'times new=\"\" roman\';color:rgb(255,0,0);font-size:14.0000pt;mso-font-kerning:1.0000pt;\"=\"\"><o:p></o:p></spanyes\';font-family:calibri;mso-fareast-font-family:宋体;mso-bidi-font-family:\'times></spanyes\';font-family:宋体;mso-ascii-font-family:calibri;mso-hansi-font-family:calibri;mso-bidi-font-family:\'times></spantimes></p><p class=\"MsoNormal\"><spanyes\';font-family:宋体;mso-ascii-font-family:calibri;mso-hansi-font-family:calibri;mso-bidi-font-family:\'times new=\"\" roman\';font-size:14.0000pt;mso-font-kerning:1.0000pt;\"=\"\"><font face=\"宋体\">一起购电子商务社群</font>+<font face=\"宋体\">新零售模式，时刻坚守匠人精神，剔除各级代理溢价和中间环节，为消费者甄选高品质、高性价比的海鲜产品。即让精选产品与网络社群进行低成本的高效自由连接。“供应链中心化”和“流量社会化”，实现平台直接供货到消费者手中，又降低了消费者的购买费用。</font><spanyes\';font-family:calibri;mso-fareast-font-family:宋体;mso-bidi-font-family:\'times new=\"\" roman\';font-size:14.0000pt;mso-font-kerning:1.0000pt;\"=\"\"><o:p></o:p></spanyes\';font-family:calibri;mso-fareast-font-family:宋体;mso-bidi-font-family:\'times></spanyes\';font-family:宋体;mso-ascii-font-family:calibri;mso-hansi-font-family:calibri;mso-bidi-font-family:\'times></p><p class=\"MsoNormal\"><spanyes\';font-family:宋体;mso-ascii-fo