INSERT INTO `news` VALUES (5, 0, '彭博曝光今年新iPhone：外观变化不大 名字仍是谜', '<p>原标题：彭博曝光今年新iPhone：外观变化不大 名字仍是谜</p><p>8月28日消息，据国外媒体报道，知情人士称，苹果将于今年9月份发布三款采用全面屏设计的新iPhone，外观较之去年iPhone X不会有太大变化。其中两款价格较高的OLED屏幕手机的处理速度更快，摄像头有相应升级；而低端LCD屏幕手机则以多种外观颜色和更大屏幕为亮点。</p><p><img src=\"http://p0.ifengimg.com/pmop/2018/0828/BC53D3B8CDC07BE04E83575CE3B7327E97801AA6_size49_w700_h394.jpeg\"></p><p>知情人士透露，苹果计划将于近期发布三款新iPhone手机，均保留去年旗舰手机iPhone X的全面屏设计。知情人士称，无论从价格、功能还是尺寸上看，这些新机型的涵盖范围都将更广，从而有利于增加其对不同消费者群体的吸引力。</p><p>然而,三款新机型都不会像去年的iPhone X或是2014年的iPhone 6那样为消费者带来全新的设计理念。一些苹果公司内部人士会将此次发布年份称之为“S年度”，也就是说当年苹果会保留以往的手机设计理念，只是在手机内部添加一些新功能。消息人士补充称，公司计划在明年对iPhone手机进行更多重大变革。</p><p>在去年11月发布之前，一些华尔街分析师预期iPhone X并不会像以往那样大获成功。不过，这款手机的销量依然强劲，帮助苹果从一个几乎停止增长的智能手机市场获得了不少份额。</p><p>即将上市的新款iPhone计划于今年9月份发布，也显示出该公司正在调整其产品战略。如今，苹果的目标不是吸引数以百万计的iPhone新用户，而是稳步提高平均价格，同时扩大活动设备总量，以支持配件、流媒体音乐和视频等数字服务的销售。</p><p>苹果资深分析师、风险投资公司Loup Ventures管理合伙人吉恩·蒙斯特（Gene Munster）称，“iPhone销售正进入年成长率为0%至5%的时期，他们今年秋季所做的事情将使他们继续保持这一发展态势。”蒙斯特补充说，对投资者来说，“真正的亮点”仍然是iPhone，因为它是苹果手表、AirPod和Apple Music等几乎所有其他苹果公司产品的核心。苹果发言人特鲁迪·穆勒(Trudy Muller)拒绝就此置评。</p><p>2016年初，该公司宣布其达到了一个新的里程碑:10亿台活跃设备。到今年年初，这个数字已经增长到13亿。下个月发布的三款新iPhone将为苹果未来发展打下重要基础。</p><p>据知情人士透露，苹果将发布一款新的高端iPhone，内部命名为D33，屏幕对角线尺寸约为6.5英寸。这将使它成为迄今为止最大的iPhone，也是市场上最大的主流智能手机之一。它将继续采用一个玻璃材质后盖以及不锈钢材质边框，手机背面配置双摄像头阵列。在手机内置软件方面，和以往手机的最大区别在于邮件和日历等应用程序中可以并排查看内容。这将是苹果第二款配置更清晰OLED屏幕的手机。</p><p>配置更大的屏幕对用户需求来说总是一种优势，” 蒙斯特说。他同时指出，这款设备应该有助于苹果推高iPhone的售价。近几个季度，iPhone的营收一直在增长。苹果最近一个季度的iphone平均售价为724美元，比去年同期上涨19%。</p><p>知情人士说，苹果还计划对市场现有的iPhone X进行升级，配置5.8英寸的OLED屏幕，内部命名为D32。据知情人士透露，新款OLED屏幕iphone的主要变化将是处理速度和摄像头。</p><p>或许最重要的手机将是一款新的、更廉价的设备，其目标是取代iPhone 8。这款内部代号为N84的新款iPhone看起来和iPhone X很像，但屏幕更大，接近6.1英寸，有多种外观颜色可选，机身采用铝质边框来代替iPhone X的不锈钢边框。它还将配置更廉价的LCD屏幕以取代iPhone的OLED屏幕，以降低成本。</p><p>一位知情人士说，较便宜的铝质边框的颜色不一定与彩色玻璃背板的颜色相同，从而简化了生产工艺。</p><p>上述知情人士说，富士康旗下的鸿海精密工业股份有限公司将代工组装这两款配置OLED屏幕的高端iPhone手机，而LCD屏幕手机将主要由鸿海和和硕(Pegatron Corp.)代工。一位知情人士说，鸿海从7月底已经开始着手组装OLED屏幕设备，而直到本月才开始组装LCD屏幕手机，部分原因是LCD面板生产面临的一些小问题。台积电仍将是新款iPhone芯片的唯一供应商，而主要的iPhone相机镜头供应商大立光电预计，随着新款苹果手机的发布，其销量将出现增长。</p><p>这三款手机都将采用苹果去年推出的基于手势的控制系统，以取代以往iPhone的home键。它们还将具有Face ID面部识别功能，这是苹果公司通过面部识别即可解锁的系统，用户仅需注视一下手机屏幕便可解锁。</p><p>从某种程度上讲，其中的低端iPhone将是苹果第二次尝试通过颜色来区分手机。2013年，苹果推出了iPhone 5c，本质上是一个塑料外壳的iPhone 5。这种策略失败了，iPhone用户更喜欢苹果手机的金属质感。今年较低成本的iPhone将使用铝质边框，能够保持一种高档手机的感觉。</p><p>“颜色总会在短期内给苹果带来一些冲击，但它不会改变iPhone的发展轨迹，” 蒙斯特说。</p>', '2018-10-27 15:38:09', 'http://yiqigou.sicau.me/static/upload/ae1cc840e8afbee1/3e4848a19abb5a53.jpg');
INSERT INTO `news` VALUES (6, 0, '“一箭双星” 北斗系统再添两颗卫星', '<p>原标题：“一箭双星” 北斗系统再添两颗卫星</p><p><img src=\"http://p2.ifengimg.com/fck/2018_42/febb16b4ddc7672_w400_h266.jpg\" alt=\"\"></p><p>新华社发</p><p>据新华社电10月15日12时23分，我国在西昌卫星发射中心用长征三号乙运载火箭（及远征一号上面级），以“一箭双星”方式成功发射第39、40颗北斗导航卫星。</p><p>据介绍，这两颗卫星属于中圆地球轨道卫星，是我国北斗三号系统第15、16颗组网卫星。</p><p>卫星经过3个多小时的飞行后顺利进入预定轨道，后续将进行测试与试验评估，并与此前发射的14颗北斗三号导航卫星进行组网，适时提供服务。</p><p>今年7月以来，北斗三号系统进入高密度组网发射任务期，以每月一次发射双星的速度加速实施组网，成功将8颗北斗三号卫星送入预定轨道。根据计划，后续还将发射两颗中圆地球轨道卫星和一颗地球同步轨道卫星，于今年年底前建成基本系统，为“一带一路”沿线国家提供服务。</p><p>这次发射的北斗导航卫星和配套运载火箭（及远征一号上面级），分别由中国科学院微小卫星创新研究院和中国航天科技集团有限公司运载火箭技术研究院抓总研制。</p>', '2018-10-27 15:38:00', 'http://yiqigou.sicau.me/static/upload/268ad9d13651462d/868ab8bda13fa15a.jpg');
INSERT INTO `news` VALUES (7, 0, '谁“杀死”了大数据创业者？裁员、缺钱、没法盈利，寒冬真的来了', '<div><img src=\"https://ss2.baidu.com/6ONYsjip0QIZ8tyhnq/it/u=870753809,2735716366&amp;fm=173&amp;app=25&amp;f=JPG?w=640&amp;h=424&amp;s=00E5F90452A286F85CDC289C0300C092\"></div><p>图片来源：视觉中国</p><p>“这两年在大数据领域，纯粹讲概念没有技术的公司都死完了。融资过很多的钱的企业虽然还存活着，但大多过的也很难受。”一位大数据领域的资深创业者，对创界网说出了整个业内的真实现状。</p><p>从2016年开始，就有人喊大数据的寒冬来了，但依然有很多资本进入大数据这个领域。到2017年《网络安全法》实施，曾经被称为大数据天堂的野蛮生长时代结束，行业进入调整期。进入2018年，洗牌持续加剧，凛冬真正来临了。</p><p>大数据公司的寒冬真的来了</p><p>在当下，大数据领域的公司基本是三分天下：BAT华为等巨头系、TalkingData华云数据Dataeye等创业系、和电信、移动、联通等国有系。</p><p>2013年到2016年，是大数据相关公司的春天，在这几年，创业公司很容易拿到融资，从几百万到数亿不等，有业内人调侃说：“行业风口期，只要在电脑上打开一个Excel表格就敢说自己是大数据公司，就有可能融到资。”不完全统计，仅在2017年的上半年，就有63家大数据创业公司获得了融资，总融资超过68亿人民币。其中获得上亿元融资的企业有17家。更有人乐观估计，在2020年，整个产业会超过13000亿</p>', '2018-10-27 15:37:50', 'http://yiqigou.sicau.me/static/upload/7da6aa70b2305213/60bafc7c106e64ba.jpg');
INSERT INTO `news` VALUES (8, 0, '传恒大停发60余名FF中国员工工资 讨薪员工欲集体仲裁', '<p>10月16日消息，腾讯《一线》昨日晚间获悉，FF中国60余名员工没有收到本应15日到账的8月21日至9月20日的工资。</p><p>一位遭薪资停发的FF员工向腾讯《一线》透露，15日晚间，部分员工在FF中国500人员工群中询问发薪事宜，恒大法拉第高管无任何回应，半小时后勒令解散公司员工群。解散当即，60余名员工随即成立讨薪群，并在群中讨论维权事宜，据最新内部消息透露，这批员工计划近期进行集体劳务仲裁。</p><div><img src=\"data:image/jpeg;base64,\" style=\"max-width:100%;\"><br></div><p>腾讯《一线》从FF内部获悉，恒大在过去的一个多月时间内，已经实际上掌握了FF中国的管理权，变更了FF中国的法人代表、董事长等职务。为加强对FF中国的掌控，恒大除了派遣恒大系高管空降FF中国外，还对FF中国职能部门员工进行了一系列的调整。</p><p>这一个多月时间中，恒大首先从FF中国公司的监察部、财务部、行政部、IT部、传播部等职能部门着手，然后再到制造部、车联网等部门，要求北京、上海等地的员工换签合同，将工作地点换签至广州，并采用薪酬绩效折半的方法（员工原薪水50%作为工资，50%作为绩效）。</p><p>据FF中国内部员工透露，上周五（10月12日），恒大法拉第HR对未换签合同60余位员工中的20余位进行了一轮“N+1”协商，明确表示“如果不去广州上班，那么只好协议解除劳动合同。”按照恒大方面给与的条件，协议解除劳动合同关系的员工在承诺离职后在不发表对公司任何言论的条件下，可以获得N+1的赔偿。但关于员工的奖金和期权都未曾提及。如员工违反承诺，则需翻倍向恒大法拉第赔偿损失。20余名员工中，包括9名品牌传播部的全部员工。</p>', '2018-10-27 15:37:37', 'http://yiqigou.sicau.me/static/upload/68e48e224b3e8594/91d650b319a4060c.jpg');
INSERT INTO `news` VALUES (9, 0, '习近平同挪威国王哈拉尔五世举行会谈', '<div><p>新华社北京10月16日电（记者李忠发）国家主席习近平16日在人民大会堂同挪威国王哈拉尔五世举行会谈，两国元首一致同意，为新时期中挪关系发展注入新动力，谱写两国传统友谊新篇章。</p><p>　　习近平欢迎哈拉尔五世来华进行国事访问，赞赏哈拉尔五世和挪威王室长期关心和支持中挪关系发展，为促进两国友谊作出了重要贡献。习近平指出，中挪关系自2016年正常化以来收获了累累硕果。推动中挪关系持续健康稳定发展，符合两国人民共同利益，也符合和平、发展、合作、共赢的时代潮流。挪威是最早承认中华人民共和国和中国市场经济地位的欧洲国家之一。明年，中挪将迎来建交65周年，中方愿同挪方以此为契机，共同开辟中挪关系更加美好的未来。</p><p align=\"center\"><img id=\"{1D8C8371-0A73-4159-91F3-0339FB53606C}\" title=\"\" border=\"0\" src=\"http://www.xinhuanet.com/politics/2018-10/16/1123568323_15396993555221n.jpg\" sourcedescription=\"编辑提供的本地文件\" sourcename=\"本地文件\"></p><p><font color=\"navy\" face=\"楷体\">　　10月16日，国家主席习近平在北京人民大会堂同挪威国王哈拉尔五世举行会谈。这是会谈前，习近平在人民大会堂东门外广场为哈拉尔五世举行欢迎仪式。 新华社记者 刘卫兵 摄</font></p><p>　　习近平强调，双方要不断巩固和增进政治互信，坚持相互尊重、平等相待的交往原则，充分尊重并切实照顾彼此核心利益和重大关切，为中挪关系行稳致远打牢政治基础。要持续深化和拓展各领域务实合作，为两国经贸合作作出全面制度性安排，实现更高水平的互利共赢。中方愿同挪方积极探讨在“一带一路”框架内开展合作，共同促进亚欧大陆互联互通。要丰富人文交流内容和形式。中方愿同挪方加强冬季运动领域交流，欢迎挪方同中方分享经验并协助推进冬奥会筹办工作。要加强在国际事务中的合作和在联合国等多边框架内的沟通和协调，推动经济全球化、倡导世界多极化、维护多边主义、促进可持续发展，携手维护世界和平稳定，推动全球治理体系朝着更加公正合理的方向发展。中方愿同挪方加强在北极理事会框架内的交流合作，希望挪威继续为中欧关系健康稳定发展、中国－北欧合作发挥积极作用。</p><p>　　哈拉尔五世表示，很高兴再次对中国进行国事访问。我和王后自1985年首次访华后多次来到中国，见证了中国的迅速发展和巨大变化。我这次访华表明挪中关系重回正轨，并再次显示出强劲的生命力。我赞同习近平主席对加强挪中合作的看法。双方合作还大有潜力可挖。我们双方要共同努力拓展互利合作。我对2008年北京奥运会印象深刻，挪方愿同中方加强冬季运动交流合作，支持中方成功举办2022年冬奥会。</p><p>　　会谈后，两国元首还共同见证了有关合作文件的签署。</p><p>　　会谈前，习近平在人民大会堂东门外广场为哈拉尔五世举行欢迎仪式。彭丽媛、杨洁篪、吉炳轩、辜胜阻等参加。</p></div><div id=\"\"><br></div>', '2018-10-27 15:37:26', 'http://yiqigou.sicau.me/static/upload/25f9a3974846485e/cf82648c7eee7abc.jpg');
INSERT INTO `news` VALUES (10, 0, '护照升值!超70个免签、落地签目的地迎接中国游客', '<p>人民网北京10月15日电 (田虎)近日，外交部领事司对中国领事服务网《持普通护照中国公民前往有关国家和地区入境便利待遇一览表》进行了更新，其中显示，目前我国公民持普通护照可以免签、落地签前往的国家和地区已经超过70个，创历史新高。而旅游业内人士表示，随着签证便利程度的进一步提升，近期一些免签、落地签目的地也成为了游客出境游的热点。</p><p><img width=\"550\" height=\"413\" src=\"http://08imgmini.eastday.com/mobile/20181017/20181017130451_4a69070c8a1f36bcf6689595d3660b8d_1.jpeg\"></p><p>资料图（图片来自网络，如有侵权请联系我们删除）</p><p>根据中国领事服务网的信息显示，对于持普通护照中国公民，截至2018年10月9日，互免普通护照签证的国家(13个)、单方面允许中国公民免签入境国家或地区(15个)、单方面允许中国公民办理落地签证国家和地区(45个)。携程旅行网相关负责人表示，超过70个目的地可以“说走就走”，相比去年同期又增加了不少，比如卡塔尔、白俄罗斯、波黑、巴巴多斯、塞尔维亚等。驴妈妈旅游网方面则表示，今年以来对于中国游客的签证利好政策不断，比如阿联酋免签(1月16日生效)、阿尔巴尼亚限时免签(4月1日—10月31日)、波黑免签(5月29日生效)等，而缅甸则是10月1日起对中国游客实行落地签政策。</p>', '2018-10-27 15:37:16', 'http://yiqigou.sicau.me/static/upload/eab2961d0df1d3b9/22a14c6c98b9064c.jpg');
INSERT INTO `news` VALUES (12, 0, '甘肃阿克塞大漠深处胡杨林秋色正浓惹人醉', '<p><img src=\"https://t1.huanqiu.cn/6f1a188318cf35409d0e2df3d4c41cae.jpg\"></p><p></p><p>　　深秋时节，位于大漠深处的甘肃酒泉市阿克塞县的胡杨林秋色正浓。错落有致的胡杨林，在阳光的照耀下，处处呈现出绚丽的金色，吸引游客在此观光赏景。高宏善 摄</p><div><br></div><p></p><p></p>', '2018-10-27 15:37:02', 'http://yiqigou.sicau.me/static/upload/6f1a188318cf3540/9d0e2df3d4c41cae.jpg');
